import axios from "axios";
import React, { useState } from "react";
import { useParams } from "react-router-dom";

const OyuncuDetay = () =>{

    let {id} = useParams()
    const [oyuncuDetay,setOyuncuDetay]=useState([])

    axios.get(`https://cryptic-gorge-72989.herokuapp.com/players/${id}`)
    .then(response=>{
        setOyuncuDetay(response.data)
    },[id])

    return(
        <div>

            <h1>
                {
                    oyuncuDetay.map(oyuncu=>
                        <div>
                            {oyuncu.name}
                        </div>
                        )
                }
            </h1>

        </div>
    )
}

export default  OyuncuDetay;
